<!-- ================= UI ================= -->

<div class="panel">
  <h2>@ADI MPN QR Generator</h2>

  <input type="text" id="mpnInput"
         placeholder="Search MPN / Item Code / Description">

  <div id="suggestions" class="suggest-box"></div>
  <div id="qrOutput"></div>
</div>

<!-- ================= SCRIPT ================= -->

<script>
let mpnData = {};

function readSheet(text, category){
  const lines = text.trim().split("\n");
  for(let i=1;i<lines.length;i++){
    const c = lines[i].split("\t");
    if(c.length < 3) continue;

    const mpn = c[0].trim();
    if(!mpnData[mpn]) mpnData[mpn] = { lists: [] };

    mpnData[mpn].lists.push({
      category: category,
      itemCode: c[1].trim(),
      description: c[2].trim()
    });
  }
}

function loadAllSheets(){
  document.querySelectorAll("textarea[id^='sheet']").forEach(t=>{
    if(t.value.trim()){
      readSheet(t.value, t.dataset.cat);
    }
  });
}

/* SEARCH */
document.getElementById("mpnInput").addEventListener("input",function(){
  const val = this.value.trim().toLowerCase();
  const sug = document.getElementById("suggestions");
  sug.innerHTML="";
  sug.style.display="none";
  if(!val) return;

  let result = new Set();

  for(let mpn in mpnData){
    if(mpn.toLowerCase().includes(val)) result.add(mpn);
    mpnData[mpn].lists.forEach(l=>{
      if(l.itemCode.toLowerCase().includes(val)) result.add(mpn);
      if(l.description.toLowerCase().includes(val)) result.add(mpn);
    });
  }

  if(!result.size) return;
  sug.style.display="block";

  [...result].forEach((mpn,i)=>{
    let d=document.createElement("div");
    d.className="suggest-item";
    d.innerText=mpn;
    if(i===0){
      d.style.background="#0033ff";
      d.style.color="#fff";
    }
    d.onclick=()=>selectMPN(mpn);
    sug.appendChild(d);
  });
});

document.getElementById("mpnInput").addEventListener("keydown",e=>{
  if(e.key==="Enter"){
    const first=document.querySelector(".suggest-item");
    if(first) selectMPN(first.innerText);
  }
});

function selectMPN(mpn){
  mpnInput.value=mpn;
  suggestions.style.display="none";
  showMPN(mpn);
}

function showMPN(mpn){
  const out=document.getElementById("qrOutput");
  out.innerHTML="";

  if(!mpnData[mpn]){
    out.innerHTML="<div class='error'>MPN not found</div>";
    return;
  }

  let html=`
    <div class="glass">
      <div class="top-text">@Adesh</div>
      <div id="qr"></div>
      <div class="mpn-text">${mpn}</div>
  `;

  mpnData[mpn].lists.forEach(l=>{
    html+=`
      <div class="divider"></div>
      <div class="cat-text">${l.category}</div>
      <div class="mpn-text">${l.itemCode}</div>
      <div class="desc-text">${l.description}</div>
    `;
  });

  html+=`</div>`;
  out.innerHTML=html;

  new QRCode(document.getElementById("qr"),{
    text: mpn,
    width:150,
    height:150
  });
}
</script>

</body>
</html>
